Stan Smith — класичні кросівки, спочатку зроблені для тенісу, розроблені більше 50 років тому. Це найпопулярніша модель за всю історію adidas. Білі кросівки зі шкіри, заслужили статус ікони стилю.

У 80-х в Америці починається бум вуличної моди. Танцюристи брейк-дансу, піонери хіп-хопу і рок-музиканти з'являються на публіці в кросівках adidas, в тому числі і Stan Smith. Кросівки adidas Stan Smith продовжують випускатися в кожній колекції adidas і в 1988 році входять в книгу рекордів Гіннеса, як найбільш продавана модель взуття в історії. Щоб цього досягти, adidas продав більше 22 мільйонів пар Stan Smith.

В сучасності силует adidas Stan Smith видається під брендом adidas Originals. Легендарні кросівки продовжують перевипускати в класичній біло-зеленою забарвленням, а також виходять в сезонних кольорах і використовуються для колаборацій.

